script: |
  super -f tsv -I q5291.sql | sort > q5291.out

vector: true

inputs:
  - name: q5291.sql
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab1 WHERE NOT ( + 28 + + - col1 ) IN ( col0 + - + col1 + + 81, ( + col1 ) * - - col0 * - 20 * + 97 - - - col1, col2, + + col0 );
  - name: tab1

outputs:
  - name: q5291.out
    data: |
      59
      68
      96
